import React,{ useState, useEffect } from "react";

function Feedback() {
  const [text,setText]=useState("Submit");
  function handleClick(){
    setText("Thank your for your feedback")
  }
  
  function submit(e){
    e.preventDefault();
    useEffect(() => {
      setTimeout(() => {
        submit();
      }, 5000);
    }, []);
    window.location.href="/city";
  }
  return (
    <>
      <textarea
        className="textarea"
        rows="10"
        cols="50"
        placeholder="Enter your feedback"
      />
      <div>
        <form onSubmit={submit} >
          <button type="submit" className="ticket-button" onClick={handleClick} style={{margin:"10px 0 0 0650px"}}>
            {text}
          </button>
        </form>
      </div>
    </>
  );
}

export default Feedback;
